  \"Data Analysis Algorithm Suitable for Structural Health Monitoring Based on Dust
  Network Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:14:53.661909\",\n\t\"name\": \"data-analysis-algorithm-suitable-for-structural-health-monitoring-based-on-dust-network-pr-6a3f4\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This proposed project will attempt to develop
  a data analysis system for structural health monitoring on space structures.  The
  data analysis software will be a key component in space vehicle health management
  system and can be used to in vehicle life prediction.  The sensor data analysis
  algorithm is aimed at providing a modeling and simulation tool for data collected
  from a network of distributed sensors.  The sensor network can be implemented via
  the state-of-the-art technology of distributed wireless dust network.  A novel algorithm
  combining measurement data from the sensors and the analytical model based on the
  concept of finite element analysis is proposed and the feasibility of the algorithm
  to detect structural damage will be tested in this project.  The project will focus
  on the impedance-based nondestructive damage evaluation technique.  However, the
  algorithm can be extended to handle other types of sensor data such as acceleration
  and temperature.  The data analysis system can monitor the performance of defective
  structural component in a space vehicle and issue proper warning for maintenance
  and repair.  If the concept is tested successful, the algorithm can be further developed
  into a commercial software to be used for the structural integrity monitoring of
  many engineering applications.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
